BEGIN;

CREATE TABLE framedata (
  id integer PRIMARY KEY,
  fighter text NOT NULL,
  command text NOT NULL,
  name text DEFAULT '~',
  execution text DEFAULT '~',
  startup text DEFAULT '~',
  level text DEFAULT '~',
  block text DEFAULT '~',
  hit text DEFAULT '~',
  blockcancel text DEFAULT '~',
  hitcancel text DEFAULT '~',
  notes text DEFAULT '~',
  image text DEFAULT '~',
  UNIQUE (fighter, command)
);


END;
